import React, { useEffect, useState } from "react";
import { useLocation } from "react-router-dom";
import "./AI.css";

function AIAnalysis() {
  const location = useLocation();
  const [analysisData, setAnalysisData] = useState(null);
  const [error, setError] = useState(null);
  const url = location.state?.url;

  useEffect(() => {
    const fetchData = async () => {
      try {
        const res = await fetch("http://localhost:5000/analyze", {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify({ url }),
        });
        const data = await res.json();
        setAnalysisData(data.summary);
      } catch (err) {
        console.error("Error fetching AI analysis:", err);
        setError("❌ Error: Failed to fetch AI analysis.");
      }
    };

    if (url) {
      fetchData();
    }
  }, [url]);

  const parseSection = (label) => {
    const regex = new RegExp(`(?<=${label}:)([\\s\\S]*?)(?=(\\n[A-Z]|$))`, "i");
    const match = analysisData?.match(regex);
    return match ? match[0].trim() : "No data available.";
  };

  return (
    <div className="ai-analysis-container">
      <div className="ai-header">
        <h1>🚨 AI News Analysis Report</h1>
        <h2>🔗 Source: {url || "N/A"}</h2>
      </div>

      {error ? (
        <div className="ai-error">{error}</div>
      ) : !analysisData ? (
        <p style={{ padding: "20px" }}>⏳ Analyzing news, please wait...</p>
      ) : (
        <div className="ai-content">
          {/* Left Column */}
          <div className="ai-left-section">
            <div className="ai-card ai-summary">
              <h3>📌 Summary</h3>
              <p>{parseSection("Summary")}</p>
            </div>

            <div className="ai-card ai-sentiment">
              <h3>📊 Sentiment Analysis</h3>
              <p>
                <strong>Overall Sentiment:</strong>{" "}
                <span className="ai-negative">🔴 Negative</span>
              </p>
              <p>
                <strong>Key Emotions Detected:</strong> Anger, Frustration,
                Concern
              </p>
            </div>

            <div className="ai-card ai-authenticity">
              <h3>✅ Authenticity Score</h3>
              <p>82% (Based on credibility indicators and AI-driven fact-checking)</p>
            </div>
          </div>

          {/* Right Column */}
          <div className="ai-right-section">
            <div className="ai-card ai-highlights">
              <h3>📢 Key Highlights</h3>
              <ul>
                {parseSection("Highlights")
                  .split("\n")
                  .map((line, i) => (
                    <li key={i}>✔️ {line}</li>
                  ))}
              </ul>
            </div>

            <div className="ai-card ai-impact">
              <h3>🌎 Impact & Implications</h3>
              <ul>
                {parseSection("Impact")
                  .split("\n")
                  .map((line, i) => (
                    <li key={i}>🔹 {line}</li>
                  ))}
              </ul>
            </div>

            <div className="ai-card ai-recommendations">
              <h3>📜 Recommendations</h3>
              <ul>
                {parseSection("Recommendations")
                  .split("\n")
                  .map((line, i) => (
                    <li key={i}>📌 {line}</li>
                  ))}
              </ul>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default AIAnalysis;
